import React, { useState } from "react";
import "./style.scss";

const ProfileUpdate = () => {
  const [formData, setFormData] = useState({
    email: "",
    phoneNumber: "",
    address: "",
    schoolName: "",
    surname: "",
    level: "",
    department: "",
    profilePicture: "",
    gender: "",
    otherName: "",
    matricNumber: "",
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // TODO: Add submit logic here
  };

  return (
    <div className="profile-update">
      <h2>Update Profile</h2>
      <form onSubmit={handleSubmit}>
        <div className="collection">
          <div className="entry">
            <label>Email:</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>MatricNumber:</label>
            <input
              type="text"
              name="matricNumber"
              value={formData.matricNumber}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>Surname:</label>
            <input
              type="text"
              name="surname"
              value={formData.surname}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>OtherName:</label>
            <input
              type="text"
              name="otherName"
              value={formData.otherName}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>Phone Number:</label>
            <input
              type="text"
              name="phoneNumber"
              value={formData.phoneNumber}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>Address:</label>
            <input
              type="text"
              name="address"
              value={formData.address}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>Gender:</label>
            <input
              type="text"
              name="gender"
              value={formData.gender}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>School Name:</label>
            <input
              type="text"
              name="schoolName"
              value={formData.schoolName}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>Department:</label>
            <input
              type="text"
              name="department"
              value={formData.department}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>Level:</label>
            <input
              type="text"
              name="level"
              value={formData.level}
              onChange={handleChange}
            />
          </div>
          <div className="entry">
            <label>School Name:</label>
            <input
              type="text"
              name="schoolName"
              value={formData.schoolName}
              onChange={handleChange}
            />
          </div>
        </div>

        <button type="submit">Update</button>
      </form>
    </div>
  );
};

export default ProfileUpdate;
